import React, { useState } from 'react'
import { count } from '../store/reducers/exampleReducer'
import Header2 from '../components/Header2'
import HeaderContent from '../components/HeaderContent'
import Footer from '../components/Footer'
import { configureStore, createSlice } from '@reduxjs/toolkit'
import { useSelector, useDispatch } from 'react-redux'

const Article3 = () => {
  const userManagamentSlice = createSlice({
    name: "userManagament",
  });

  const store = configureStore({
    reducer: userManagamentSlice.reducer,
  });
  const { images, imagess, countt } = useSelector((state) => state.userManagament);
  const dispatch = useDispatch();

  return (
    <div>
      <Header2 />
      <div className="w-full min-h-[90vh] flex items-center h-full bg-[#f2f2f2] p-4">
        <div className="m-auto container bg-stone-200 grid h-full h-fit p-4">
          <img src={imagess[countt].id} className='h-full m-auto max-h-[80vh]' alt="" />
        </div>
      </div>
      <Footer />
    </div>
  )
}

export default Article3
